import React from 'react';

function FilterOptions() {
  return (
    <div>
      <button>Categories (Election, Middle East, etc)</button>
      <button>Timeframe (e.g., upcoming week, month)</button>
      <button>Profitability Threshold</button>
    </div>
  );
}

export default FilterOptions;
